import React from "react";
import { CircularProgress, Grid, Typography } from "@material-ui/core";
// hook
import { useFetch } from "../../../hooks";
// components
import CultrueCards from "./CultureCards";
import Collapse from "@material-ui/core/Collapse";
import { List, ListItem, ListItemText } from "@material-ui/core";
const useStyles = makeStyles((theme) => ({
  root: {
    width: "100%",
    maxWidth: 360,
    backgroundColor: theme.palette.background.paper,
  },
  nested: {
    paddingLeft: theme.spacing(4),
  },
}));
const ClientInstitution = () => {
  const { data, isLoading } = useFetch("/cultures/group");
  const [open, setOpen] = React.useState(true);

  const handleClick = () => {
    setOpen(!open);
  };

  <Collapse in={open} timeout="auto" unmountOnExit>
    <List component="div" disablePadding>
      <ListItem button className={classes.nested}>
        <ListItemIcon>
          <StarBorder />
        </ListItemIcon>
        <ListItemText primary="Starred" />
      </ListItem>
    </List>
  </Collapse>;
  const cultureCards = data.map((information) => (
    <Grid key={information._id} item xs={12}>
      <Typography variant="h6">{information._id}</Typography>
      <CultrueCards
        countrySource={information._id}
        information={information.data}
      />
    </Grid>
  ));

  return (
    <div>
      <Grid item xs={12}>
        <Grid container spacing={3}>
          {isLoading ? (
            <Grid item xs={12}>
              <CircularProgress />
            </Grid>
          ) : (
            cultureCards
          )}
        </Grid>
      </Grid>
    </div>
  );
};

export default ClientInstitution;
